import{_ as r,o as t,c as a,Q as e}from"./chunks/framework.5ac6f4ea.js";const p="/Hrsw-Twlog/assets/2023-04-20-8-0.c7603e2f.png",s="/Hrsw-Twlog/assets/2023-04-20-9-0.01f443c5.png",o="/Hrsw-Twlog/assets/2023-04-20-10-0.10eee386.png",i="/Hrsw-Twlog/assets/2023-04-20-11-0.12b84de2.png",h="/Hrsw-Twlog/assets/2023-04-20-12-0.3e1d5b00.png",n="/Hrsw-Twlog/assets/2023-04-20-13-0.2d9c3c22.png",T=JSON.parse('{"title":"2023-04-20","description":"","frontmatter":{"title":"2023-04-20T00:00:00.000Z"},"headers":[],"relativePath":"Twitter/2023-04-20.md","filePath":"Twitter/2023-04-20.md"}'),_={name:"Twitter/2023-04-20.md"},m=e('<h1 id="_2023-04-20" tabindex="-1">2023-04-20 <a class="header-anchor" href="#_2023-04-20" aria-label="Permalink to &quot;2023-04-20&quot;">​</a></h1><p><a href="https://twitter.com/hirasawa/status/1649035194568163328#m" target="_blank" rel="noreferrer">20 Apr, 2023 10:00 PM</a></p><p>近所のスーパーの脇にもやや紫なピンクのはなみずきが咲いているのを発見した。それは丁度換気扇の前で唐揚げの匂いを浴びて咲いていた。</p><p>私もそうやって咲く方法を学んで来た。</p><p>花よ。</p><p>またこんど！！</p><hr><p><a href="https://twitter.com/hirasawa/status/1649033926395170816#m" target="_blank" rel="noreferrer">20 Apr, 2023 09:55 PM</a></p><p>こんなやつ</p><p>！</p><hr><p><a href="https://twitter.com/hirasawa/status/1649032667948625920#m" target="_blank" rel="noreferrer">20 Apr, 2023 09:50 PM</a></p><p>近所の病院に咲く花々を見に行き、この花は何だ？！と思って画像検索をした結果それははなみずきでありました。私が「なんだ！これはやや紫なピンクのはなみずきなのか！」というと後ろを通りかかった顔に包帯グルグル巻きの人が頭上に感嘆符を出現させた！</p><hr><p><a href="https://twitter.com/hirasawa/status/1649031410303348736#m" target="_blank" rel="noreferrer">20 Apr, 2023 09:45 PM</a></p><p>数週間前に、この世にはやや紫なピンクのハナミズキがあることを知った。</p><p>やや紫なピンクのハナミズキが無かった人生を返して欲しい。</p><hr><p><a href="https://twitter.com/hirasawa/status/1649030151282237441#m" target="_blank" rel="noreferrer">20 Apr, 2023 09:40 PM</a></p><p>先日脱兎に乗り高速を１時間走って撮影して来た映像は立派に使えました。</p><hr><p><a href="https://twitter.com/hirasawa/status/1649028893263659009#m" target="_blank" rel="noreferrer">20 Apr, 2023 09:35 PM</a></p><p>しかし納車後は赤信号で前倒し発進するような乗り物ではないようにお願いします。</p><hr><p><a href="https://twitter.com/hirasawa/status/1649027637409447937#m" target="_blank" rel="noreferrer">20 Apr, 2023 09:30 PM</a></p><p>５つ戻る双六TW。</p><p>私が前倒ししているんだから納車も前倒しして欲しい。</p><hr><p><a href="https://twitter.com/hirasawa/status/1649026376463179776#m" target="_blank" rel="noreferrer">20 Apr, 2023 09:25 PM</a></p><p>野戦病院のナースに束の間の休息をと木々は枝の毛細管に時空を吸い上げ終戦の野辺に彼女をうたた寝させる。 <img src="'+p+'" alt="image"></p><hr><p><a href="https://twitter.com/hirasawa/status/1649025118549442560#m" target="_blank" rel="noreferrer">20 Apr, 2023 09:20 PM</a></p><p>巨大船舶を推進させるスクリューが骨休みする方法は花のフリをして人様の庭で厳然することである。 <img src="'+s+'" alt="image"></p><hr><p><a href="https://twitter.com/hirasawa/status/1649023860191404032#m" target="_blank" rel="noreferrer">20 Apr, 2023 09:15 PM</a></p><p>東南アジアの女児が着るちょうちん袖のブラウスに現れる神の紋章。 <img src="'+o+'" alt="image"></p><hr><p><a href="https://twitter.com/hirasawa/status/1649022601845690374#m" target="_blank" rel="noreferrer">20 Apr, 2023 09:10 PM</a></p><p>月締メより抜粋。</p><p>デトックス祈願の二連発。 <img src="'+i+'" alt="image"></p><hr><p><a href="https://twitter.com/hirasawa/status/1649021344191848449#m" target="_blank" rel="noreferrer">20 Apr, 2023 09:05 PM</a></p><p>一足早く月締メ・フォルマントが納品された。</p><p>いろいろと前倒しで攻めている。 <img src="'+h+'" alt="image"></p><hr><p><a href="https://twitter.com/hirasawa/status/1649020097275760641#m" target="_blank" rel="noreferrer">20 Apr, 2023 09:00 PM</a></p><p>枯れヤシと中井デザイン <img src="'+n+'" alt="image"></p><hr>',48),l=[m];function c(w,g,f,u,d,P){return t(),a("div",null,l)}const k=r(_,[["render",c]]);export{T as __pageData,k as default};
